import React from 'react';
import './App.css';
import Person from './Person/Person';

function App() {
  return (
    <div className="App">
      <h1> hi hello world</h1>
      <button> switch user </button>
      <Person name = "saad" age = "25"/>
      <Person name = "hamza" age = "26"/>      
      <Person name = "said" age = "22"/>      
      <Person name = "aga" age = "20"/>      

    </div>
  );
}

export default App;
